Eine Karte der Vergangenheit und der Gedächtnisse, 
schauend, wie -- zum Beispiel -- auf Kindheit rückseitig; 
Glück, Genuß, aber von der Vergangenheit eher kommen; 
Sachen, die verschwunden sind. Ein anderer Messwert hebt 
dieses auf und gibt neue Relationen, Neuerkenntnis, neues Klima, und 
dann disporting die Kinder in einem nicht vertrauten Bezirk.

Übereinstimmung, Contentment, körperliches bien-?tre;
